import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const App = () =>{
    return(
    <>
    <nav className="navigation bg-danger p-2">
    <ul className="menu d-flex list-unstyled">
        <li className=" "><a href="Home">Home"</a></li>
        <li><a href="New Movies">New Movies</a></li>
        <li><a href="Old Movies">Old Movies</a></li>
        <li><a href="Dubed Movies">Dubed Movies</a></li>
    </ul>
    </nav>,  
   {Sdata.map((val, index)=>{
     return(
       <Card
         imgsrc={val.imgsrc}
         category={val.category}
         title={val.title}
         link={val.link}
       />
     )
   })}
     
    </>
    )
}
export default App;
